(26, '1', 'VONGQUAY', 'vong-quay-may-man-5k', '{\"author\":\"SIEUTHICODE.NET\",\"name_product\":\"V\\u00d2NG QUAY MAY M\\u1eaeN 5K\",\"thumb\":\"assets\\/minigame\\/dc6851b630714333d1d0838d2fcb6c53.gif\",\"vongquay\":\"assets\\/minigame\\/1425044bb2c7ac533f9c30a7e74d0b7d.png\",\"open\":null,\"close\":null,\"lenh_admin\":\"5\",\"lenh_user\":\"1,2,2,3,3,3,4,4,4,5,5,5,5\",\"tag\":\"\",\"cash\":\"5000\",\"fake_spin\":\"0127\",\"sale_cash\":\"0\",\"thele\":\"<p>V\\u00d2NG QUAY MAY M\\u1eaeN 10K\\u00a0<\\/p>\\r\\n\\r\\n<p>1. M\\u1ee5c \\u0110\\u00edch:<\\/p>\\r\\n\\r\\n<p>M\\u1ee5c \\u0111\\u00edch c\\u1ee7a tr\\u00f2 ch\\u01a1i l\\u00e0 \\u0111\\u1ec3 ng\\u01b0\\u1eddi ch\\u01a1i quay v\\u00f2ng v\\u00e0 nh\\u1eadn \\u0111\\u01b0\\u1ee3c ph\\u1ea7n th\\u01b0\\u1edfng t\\u1eeb c\\u00e1c lo\\u1ea1i PET kh\\u00e1c nhau theo t\\u1ec9 l\\u1ec7 may m\\u1eafn \\u0111\\u00e3 \\u0111\\u01b0\\u1ee3c x\\u00e1c \\u0111\\u1ecbnh tr\\u01b0\\u1edbc.<br \\/>\\r\\n2. Danh S\\u00e1ch Ph\\u1ea7n Th\\u01b0\\u1edfng:<\\/p>\\r\\n\\r\\n<p>PET \\u0110\\u1ece: 30% t\\u1ec9 l\\u1ec7 xu\\u1ea5t hi\\u1ec7n.<br \\/>\\r\\nACC GACHA c\\u00f3 s\\u1eafn 120 k\\u1ec9 v\\u1eadt :\\u00a030% t\\u1ec9 l\\u1ec7 xu\\u1ea5t hi\\u1ec7n.<br \\/>\\r\\nPET XANH D\\u01af\\u01a0NG: 20% t\\u1ec9 l\\u1ec7 xu\\u1ea5t hi\\u1ec7n.<br \\/>\\r\\nPET XANH L\\u00c1: 10% t\\u1ec9 l\\u1ec7 xu\\u1ea5t hi\\u1ec7n.<br \\/>\\r\\nPET T\\u00cdM: 10% t\\u1ec9 l\\u1ec7 xu\\u1ea5t hi\\u1ec7n.<br \\/>\\r\\n3. Quy T\\u1eafc:<\\/p>\\r\\n\\r\\n<p>M\\u1ed7i l\\u01b0\\u1ee3t quay v\\u00f2ng c\\u00f3 th\\u1ec3 ch\\u1ecdn m\\u1ed9t s\\u1ed1 l\\u1ea7n quay t\\u00f9y theo quy \\u0111\\u1ecbnh c\\u1ee7a t\\u1eebng phi\\u00ean b\\u1ea3n c\\u1ee7a tr\\u00f2 ch\\u01a1i.<br \\/>\\r\\nNg\\u01b0\\u1eddi ch\\u01a1i s\\u1ebd quay v\\u00f2ng v\\u00e0 nh\\u1eadn \\u0111\\u01b0\\u1ee3c ph\\u1ea7n th\\u01b0\\u1edfng t\\u01b0\\u01a1ng \\u1ee9ng v\\u1edbi PET n\\u00e0o m\\u00e0 v\\u00f2ng quay d\\u1eebng l\\u1ea1i.<br \\/>\\r\\n4. C\\u00e1ch Th\\u1ee9c Ch\\u01a1i:<\\/p>\\r\\n\\r\\n<p>Ng\\u01b0\\u1eddi ch\\u01a1i s\\u1ebd b\\u1ea5m n\\u00fat ho\\u1eb7c ch\\u1ea1m v\\u00e0o m\\u00e0n h\\u00ecnh \\u0111\\u1ec3 b\\u1eaft \\u0111\\u1ea7u quay v\\u00f2ng.<br \\/>\\r\\nV\\u00f2ng quay s\\u1ebd quay v\\u00f2ng v\\u00e0 d\\u1eebng l\\u1ea1i t\\u1ea1i m\\u1ed9t PET ng\\u1eabu nhi\\u00ean.<br \\/>\\r\\nPET m\\u00e0 v\\u00f2ng quay d\\u1eebng l\\u1ea1i s\\u1ebd l\\u00e0 ph\\u1ea7n th\\u01b0\\u1edfng c\\u1ee7a ng\\u01b0\\u1eddi ch\\u01a1i.<br \\/>\\r\\n5. L\\u01b0u \\u00dd:<\\/p>\\r\\n\\r\\n<p>T\\u1ec9 l\\u1ec7 xu\\u1ea5t hi\\u1ec7n c\\u1ee7a c\\u00e1c PET \\u0111\\u01b0\\u1ee3c x\\u00e1c \\u0111\\u1ecbnh tr\\u01b0\\u1edbc v\\u00e0 kh\\u00f4ng th\\u1ec3 thay \\u0111\\u1ed5i.<br \\/>\\r\\nTr\\u00f2 ch\\u01a1i \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf \\u0111\\u1ec3 mang t\\u00ednh gi\\u1ea3i tr\\u00ed v\\u00e0 kh\\u00f4ng li\\u00ean quan \\u0111\\u1ebfn c\\u1edd b\\u1ea1c th\\u1ef1c s\\u1ef1.<br \\/>\\r\\nVi\\u1ec7c tham gia tr\\u00f2 ch\\u01a1i kh\\u00f4ng bao g\\u1ed3m vi\\u1ec7c \\u0111\\u1eb7t c\\u01b0\\u1ee3c b\\u1eb1ng ti\\u1ec1n th\\u1eadt.<br \\/>\\r\\n6. Qu\\u1ea3n L\\u00fd:<\\/p>\\r\\n\\r\\n<p>B\\u1ea5t k\\u1ef3 tranh ch\\u1ea5p n\\u00e0o v\\u1ec1 k\\u1ebft qu\\u1ea3 c\\u1ee7a v\\u00f2ng quay s\\u1ebd \\u0111\\u01b0\\u1ee3c gi\\u1ea3i quy\\u1ebft theo quy\\u1ebft \\u0111\\u1ecbnh c\\u1ee7a nh\\u00e0 s\\u1ea3n xu\\u1ea5t ho\\u1eb7c qu\\u1ea3n l\\u00fd tr\\u00f2 ch\\u01a1i.<br \\/>\\r\\nQu\\u1ea3n l\\u00fd c\\u00f3 quy\\u1ec1n thay \\u0111\\u1ed5i ho\\u1eb7c c\\u1eadp nh\\u1eadt c\\u00e1c quy t\\u1eafc v\\u00e0 \\u0111i\\u1ec1u kho\\u1ea3n c\\u1ee7a tr\\u00f2 ch\\u01a1i m\\u00e0 kh\\u00f4ng c\\u1ea7n th\\u00f4ng b\\u00e1o tr\\u01b0\\u1edbc.<br \\/>\\r\\n7. Ch\\u1ea5p Nh\\u1eadn:<\\/p>\\r\\n\\r\\n<p>Vi\\u1ec7c tham gia tr\\u00f2 ch\\u01a1i \\u0111\\u01b0\\u1ee3c xem l\\u00e0 vi\\u1ec7c ch\\u1ea5p nh\\u1eadn m\\u1ecdi \\u0111i\\u1ec1u kho\\u1ea3n v\\u00e0 quy \\u0111\\u1ecbnh c\\u1ee7a tr\\u00f2 ch\\u01a1i, bao g\\u1ed3m c\\u1e